    Executive Committee of Alabama.  Accordingly the DNC provides memo schedules on
    a semi-annual basis and not with each proceed transfer.  The memo entries in this
    report reflect activity for the first six months of 2003.  The actual proceed
    transfer fromthe Victgory Fund is not limited to the dates of this reporting period.  Likewise,
    Dolalrs for Democrats is also an ongoing fundraising program and the memo entries
    reflect activity that is reported to the FEC during this reporting period.  The
    actual proceed transfer from Dollars for Democrats is not limited to the dates
    of this reporting period.  There was no FEA during this reporting period."'
